-- Volcando estructura para función colfe_db.generar_litros_leche
DELIMITER //
CREATE FUNCTION `generar_litros_leche`(fecha DATE, id_socio INT) RETURNS decimal(10,2)
BEGIN
    DECLARE base_litros DECIMAL(10,2);
    DECLARE variacion DECIMAL(10,2);
    DECLARE litros_final DECIMAL(10,2);
    
    -- Base según el ID (para diferenciar productores)
    SET base_litros = 50 + (id_socio % 20); -- Entre 50 y 70 litros base
    
    -- Variación estacional (más producción en épocas de lluvia)
    IF MONTH(fecha) BETWEEN 4 AND 6 OR MONTH(fecha) BETWEEN 10 AND 11 THEN
        SET variacion = RAND() * 15 + 5; -- Aumento en temporadas lluviosas
    ELSE
        SET variacion = RAND() * 10 - 5; -- Variación normal o leve disminución
    END IF;
    
    -- Variación aleatoria diaria
    SET variacion = variacion + (RAND() * 8 - 4);
    
    -- Asegurar mínimo de producción
    SET litros_final = base_litros + variacion;
    IF litros_final < 30 THEN SET litros_final = 30; END IF;
    
    RETURN ROUND(litros_final, 2);
END//
DELIMITER ;

-- Volcando estructura para función colfe_db.random_identification
DELIMITER //
CREATE FUNCTION `random_identification`() RETURNS varchar(20) CHARSET utf8mb3
BEGIN
    RETURN CONCAT(FLOOR(RAND() * 90) + 10, 
                  FLOOR(RAND() * 900) + 100, 
                  FLOOR(RAND() * 900) + 100);
END//
DELIMITER ;

-- Volcando estructura para función colfe_db.random_name
DELIMITER //
CREATE FUNCTION `random_name`(type INT) RETURNS varchar(50) CHARSET utf8mb3
BEGIN
    DECLARE first_names VARCHAR(1000);
    DECLARE last_names VARCHAR(1000);
    DECLARE random_first VARCHAR(50);
    DECLARE random_last VARCHAR(50);
    
    SET first_names = 'Juan,Maria,Carlos,Ana,Luis,Laura,Pedro,Sofia,Andres,Patricia,Jorge,Daniela';
    SET last_names = 'Gomez,Rodriguez,Lopez,Martinez,Garcia,Perez,Gonzalez,Sanchez,Ramirez,Torres,Diaz,Flores';
    
    SET random_first = SUBSTRING_INDEX(SUBSTRING_INDEX(first_names, ',', FLOOR(1 + RAND() * 12)), ',', -1);
    SET random_last = SUBSTRING_INDEX(SUBSTRING_INDEX(last_names, ',', FLOOR(1 + RAND() * 12)), ',', -1);
    
    RETURN IF(type = 1, random_first, random_last);
END//
DELIMITER ;

